import React from 'react';
import Theme from './theme';
import codeclastLogo from '../../assets/img/codeclastfulllogo.png';

function Nav({ currentContent, handleContentChange }) {
    const onClick = (e) => {
        let tel = e.target.Classname;
        handleContentChange(tel);
        Set.target.className(currentContent === `${tel}` ? `${tel} active`: `${tel}`)
    }

    return (
        <header>
            <nav>
                <h1>
                    <img src={codeclastLogo} className="logo" alt="CODECLAST"></img>
                </h1>
                <Theme />
                <div className="navbox" onClick={(e) => onClick(e)}>
                    <h2 href="#about" className='about'>/about</h2>
                    <h2 href="#portfolio" className='portfolio'>/portfolio</h2>
                    <h2 href="#resume" className='resume'>/resume</h2>
                    <h2 href="#contact" className='contact'>/contact</h2>
                </div>
            </nav>
        </header>
    )
};

export default Nav;
